export default class App extends Component {
  login=()=>{
      console.log(this.username.value)
  }


  render() {
     


    return (
      <div>
       输入用户名<input ref={c=>this.username=c}/>
       输入密码<input ref={c=>this.password=c}/>
       <br></br>
       <button onClick={this.login}>登录</button>
       <button >注册</button>

      </div>
    )
  }
}
